  };

  const prevImage = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === 0 ? imageLinks.length - 1 : prevIndex - 1
    );
  };
  return (
    <div className="page">





      <section className="popular-health-checkups">
        <h2>Popular Health Checkups</h2>
